import React, {Component} from 'react';

class App extends Component {
    render(){
        return(
            <div>
                <div>Countdown to Decemeber 25, 2017</div>
                <div>
                    <div> 14 Days </div>
                    <div> 30 hours </div>
                    <div> 15 minutes </div>
                    <div> 20 seconds </div>
                </div>
            </div>
        )
    }
}

export default App;
